import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
function Bsolo1r({ data }) {
  const navigate = useNavigate();
  let [pd, spd] = useState([]);
  useEffect(() => {
    const pr = async () => {
      await axios.get("http://localhost:4000/bs1r").then((d) => {
        spd(d.data.bsolo1);
      });
    };
    pr();
  }, []);
  const cr = () => {
    navigate("/result");
  };
  console.log(data);
  return (
    <div className="sr">
      <div className="rc">
        <button id="rc" onClick={cr}>
          X
        </button>
      </div>
      <div className="pd">
        <div className="w">WINNER : 100</div>
        <div className="r">RUNNER : 50</div>
        <div className="k">KILL : 10</div>
      </div>
      <table>
        <tr>
          <th>POSITION</th>
          <th>PLAYER NAME</th>
          <th>KILLS</th>
          <th>CASH</th>
        </tr>
        {pd.map((i) => (
          <tr>
            <td>{i.position}</td>
            <td>{i.gamename}</td>
            <td>{i.kills}</td>
            <td>{i.kills}</td>
          </tr>
        ))}
      </table>
    </div>
  );
}
export default Bsolo1r;
